import React, {Component} from "react";

class IntroPage extends Component {
    state = {  } 
    render() { 
        return (
        <div> 
        
            <meta property='og:image' content='assets/imgpreview.png'/>
            <link rel="stylesheet" href="style.css" />
            <title>Period Pal</title>

                    <div class="title"></div>
                    <section class="bg" id="backg"></section>
                    <p>press 'enter' to start listing</p>

                    <script src="script.js"></script>
        </div>

        );
    }
}
 
export default IntroPage;
